import image from "../img.png";


function Home() {
  return (

    <div class="container">
    <ImageBackground source={require('background image path')} style={{width: '100%', height: '100%'}}>
    <View style={{position: 'absolute', top: 0, left: 0, right: 0, bottom: 0, justifyContent: 'center', alignItems: 'center'}}>
     <Text>Centered text</Text>
    </View>
   </ImageBackground>
    <div class="row">
    <div class="col-md-4 col-lg-4">
    <h1 className="heading-home home">Uber <span className="heading-eats heading-home">Eats</span></h1>
    </div>

    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-outline-primary home">Customer Login</button>
    </div>
    <div class="col-md-4 col-lg-4">
    <button type="button" class="btn btn-outline-primary home">Restuarant Login</button>
    </div>
    </div>
    </div>
  );
}

export default Home;
